import React from "react"

function Mapping(){
    const object = [{
        name : "muneeb",
        age : "20",
        email : "abc@email.com"
    }]
    return(
        <div>
            <h1>Mapping</h1>
            <h2>
                {
                    object.map((item)=>
                    <div>
                        {item.age}
                    </div>

                    )
                }
            </h2>
        </div>
    )
}

export default Mapping
